// import React from "react";
// import { Sidebar, Menu, MenuItem } from "react-pro-sidebar";
// import { Link } from "react-router-dom";



// export default function Sidebardash() {
//     return (
//         <div>

//             <Sidebar style={{ backgroundColor: "black", color: "white", height: "90vh" }}>
//                 <Menu
//                     menuItemStyles={{
//                         button: {
//                             // the active class will be added automatically by react router
//                             // so we can use it to style the active menu item
//                             [`&.active`]: {
//                                 backgroundColor: "#13395e",
//                                 color: "#b6c8d9",
//                             },
//                         },
//                     }}
//                 >
//                     <MenuItem component={<Link to="/" />}>
//                         Dashboard
//                     </MenuItem>

//                     <MenuItem component={<Link to="/aboutus" />}>
//                         Aboutus
//                     </MenuItem>

//                     <MenuItem component={<Link to="/e-commerce" />}>
//                         E-commerce
//                     </MenuItem>
//                 </Menu>
//             </Sidebar>

//         </div>
//     );
// }


import * as React from 'react';
import Box from '@mui/material/Box';
// import Drawer from '@mui/material/Drawer';
import Toolbar from '@mui/material/Toolbar';
import List from '@mui/material/List';
import Divider from '@mui/material/Divider';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import Typography from '@mui/material/Typography';
import HomeIcon from '@mui/icons-material/Home';
import SellIcon from '@mui/icons-material/Sell';
import AddShoppingCartIcon from '@mui/icons-material/AddShoppingCart';
import InfoIcon from '@mui/icons-material/Info';
import { Link } from 'react-router-dom';
import { styled } from '@mui/material/styles';
import MuiDrawer from '@mui/material/Drawer';

const drawerWidth = 240;

const openedMixin = (theme) => ({
    width: drawerWidth,
    transition: theme.transitions.create('width', {
        easing: theme.transitions.easing.sharp,
        duration: theme.transitions.duration.enteringScreen,
    }),
    overflowX: 'hidden',
});

const closedMixin = (theme) => ({
    transition: theme.transitions.create('width', {
        easing: theme.transitions.easing.sharp,
        duration: theme.transitions.duration.leavingScreen,
    }),
    overflowX: 'hidden',
    width: `calc(${theme.spacing(7)} + 1px)`,
    [theme.breakpoints.up('sm')]: {
        width: `calc(${theme.spacing(8)} + 1px)`,
    },
});

// const DrawerHeader = styled('div')(({ theme }) => ({
//     display: 'flex',
//     alignItems: 'center',
//     justifyContent: 'flex-end',
//     padding: theme.spacing(0, 1),
//     // necessary for content to be below app bar
//     ...theme.mixins.toolbar,
// }));


const Drawer = styled(MuiDrawer, { shouldForwardProp: (prop) => prop !== 'open' })(
    ({ theme, open }) => ({
        width: drawerWidth,
        flexShrink: 0,
        whiteSpace: 'nowrap',
        boxSizing: 'border-box',
        ...(open && {
            ...openedMixin(theme),
            '& .MuiDrawer-paper': openedMixin(theme),
        }),
        ...(!open && {
            ...closedMixin(theme),
            '& .MuiDrawer-paper': closedMixin(theme),
        }),
    }),
);


export default function Sidebardash({ sidebarOpen }) {

    return (
        <div>
            {/* <NavBar toggleSidebar={toggleSidebar}></NavBar> */}
            <Box sx={{ display: 'flex' }} >
                <Drawer variant="permanent"
                    anchor="left"
                    open={sidebarOpen}
                >

                    <Toolbar />
                    <Divider />
                    <List>
                        <ListItem disablePadding component={Link} to={"/"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Dashboard
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/product"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <SellIcon></SellIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Product
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/orders"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <AddShoppingCartIcon></AddShoppingCartIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Orders
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/orders"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <InfoIcon></InfoIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    About Us
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>



                    </List>

                    <br />
                    <Divider />
                    <Typography sx={{ color: 'primary.700' }}>
                        ACCOUNT PAGES
                    </Typography>
                    <List>
                        <ListItem disablePadding component={Link} to={"/profile"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Profile
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/singin"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Sign In
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/signup"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Sign Up
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                        <ListItem disablePadding component={Link} to={"/logout"}>
                            <ListItemButton>
                                <ListItemIcon>
                                    <HomeIcon></HomeIcon>
                                </ListItemIcon>
                                <ListItemText sx={{ ml: "-20px" }}>
                                    Log Out
                                </ListItemText>
                            </ListItemButton>
                        </ListItem>

                    </List>
                </Drawer>

            </Box >
        </div>

    );
}
